import React from 'react'
import { useAllBookingQuery } from '../../generated/graphql'

interface Props {

}

export const AdminPage: React.FC<Props> = () => {

    const {data} = useAllBookingQuery()

    const boolValue = (x: boolean) =>{
        if(x){
            <div>true</div>
        } else{
            <div>false</div>
        }
    }

    return (<div>
        <div>Bookings</div>
        <ul>
                {data?.allBooking?.map(x => {
                return <li key={x.id}> {x.id}, {x.to}, {x.from}, {x.propertyId}, {x.deleted.valueOf}</li> })
        }
        </ul>
    </div>)

}
